import { Injectable, Logger, OnApplicationBootstrap } from '@nestjs/common';
import { UserService } from '../user/user.service';
import { ProfileService } from '../profile/profile.service';

@Injectable()
export class SeedService implements OnApplicationBootstrap {
  private readonly logger = new Logger(SeedService.name);

  constructor(
    private readonly userService: UserService,
    private readonly profileService: ProfileService,
  ) {}

  async onApplicationBootstrap() {
    try {
      this.logger.log('Seeding database...');

      // Users.
      const userAdmin = await this.userService.create(
        {
          id: 'a2164494-0107-4562-b482-e5dc64eee380',
          username: 'admin',
          roles: ['admin'],
          createdAt: new Date(2023, 6, 1),
        } as any,
        'Admin123',
      );

      const userBrock = await this.userService.create(
        {
          id: 'a2164494-0107-4562-b482-e5dc64eee381',
          username: 'brock',
          roles: ['gym-leader'],
          createdAt: new Date(2023, 7, 3),
        } as any,
        'Brock123',
      );

      const userMisty = await this.userService.create(
        {
          id: 'a2164494-0107-4562-b482-e5dc64eee382',
          username: 'misty',
          roles: ['gym-leader'],
          createdAt: new Date(2023, 7, 3),
        } as any,
        'Misty123',
      );

      const userAsh = await this.userService.create(
        {
          id: 'a2164494-0107-4562-b482-e5dc64eee383',
          username: 'ash',
          roles: ['trainer'],
        } as any,
        'Ash123',
      );

      // Profiles.
      await this.profileService.update(userAdmin!.id, {
        displayName: 'Administrator',
        motd: 'I am the Pimon Portal Administrator.',
        favoritePokemon: [],
        badges: [],
        imageBase64Url: null,
      });

      await this.profileService.update(userBrock!.id, {
        displayName: 'Brock',
        motd: 'I am the Pewter City Gym Leader.',
        favoritePokemon: [74, 95],
        badges: [1],
        imageBase64Url: `data:image/jpeg;base64,`,
      });

      await this.profileService.update(userMisty!.id, {
        displayName: 'Misty',
        motd: 'I am the Cerulean City Gym Leader.',
        favoritePokemon: [120, 121],
        badges: [1, 2],
        imageBase64Url: `data:image/png;base64,`,
      });

      await this.profileService.update(userAsh!.id, {
        displayName: 'Ash Ketchum',
        motd: 'I am a Pokémon Trainer.',
        favoritePokemon: [25, 3, 6, 9, 131, 143],
        badges: [1, 2, 3, 4, 5, 6, 7, 8],
        imageBase64Url: `data:image/png;base64,`,
      });

      this.logger.log('Database seeded.');
    } catch (e) {
      this.logger.error('Error seeding database.', e);
    }
  }
}
